import "./App.css";
import styled from "styled-components";
import Sidebar from "./components/layout/Sidebar";
import TopBar from "./components/layout/TopBar";

const Container = styled.div`
  background-color: #f0f2f5;
  height: 100%;
`;

const App = () => {
  return (
    <Container>
      <Sidebar />
      <TopBar />
    </Container>
  );
};

export default App;
